description:
Dennis the Menace Christmas, A (2007)

Canada / Verenigde Staten
Familie / Komedie
83 minuten

geregisseerd door Ron Oliver
met Maxwell Perry Cotton, Robert Wagner en Louise Fletcher

Mr. George Wilson is een nare, gierige man, die geen enkele moeite doet om vriendelijk te zijn voor zijn omgeving. Dennis Mitchell is een kleine jongen uit de buurt die de norse Mr. Wilson op andere gedachten wil brengen. Uiteindelijk krijgt Dennis de hulp van een engel om Mr. Wilson de ware kerstgedachte duidelijk te maken. A Dennis the Menace Christmas is een eigentijdse versie van A Christmas Carol van Charles Dickens.

